import { useState, useEffect } from "react";
import { Link, useNavigate, useParams } from "react-router-dom";
import { getSerial, getShops } from "../api";


export default function Serial() {
    const params = useParams();
    const [isLoading, setIsLoading] = useState(true);
    const serial_id = params.id;
    useEffect(() => {
        if (isLoading) {
            getSerial({ serial_id })
                .then((result) => {
                    console.log(result);
                })
                .catch((error) => console.log(error))
            getShops()
        }
    })
    return (
        <div className="relative overflow-x-auto shadow-md ml-6 mr-2">
            <h1>Serial {params.id}</h1>
        </div>
    )
}
